"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F1978792\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Treatment of rheumatic diseases of soft tissues of the musculoskeletal system (eg, muscular rheumatism, lumbago, sciatica, tenosynovitis, bursitis, blunt traumas such as those caused by a sporting injury [contusions, sprains, and strains])",
"    </p>",
"   </div>",
