"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        1. Do you plan to become pregnant? When?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Are you currently having sex with a male partner?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. What have you used before to prevent pregnancy?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. What did you like/dislike about the method(s)?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. Are you a good pill taker?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6. How often did you forget to use the method?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        7. Are there any methods you have heard about and would like to try?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        8. Is sex usually planned or spontaneous?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        9. Is protection from sexually transmitted infections important considering your life situation?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        10. Is cost an issue? Does your health insurance plan cover any birth control method?",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
